import React, { useEffect } from 'react'

export default ChildComponent => {
    const ComposedComponent = ({ auth, history: { push } }) => {
        useEffect(() => !auth && push('/'), [auth])

        return <ChildComponent />
    }

    return ComposedComponent
}
